import style from "./Contacto.module.css";

const Contacto = () =>{
    return(
        <div className={style.ContactoContainer}>
            <h1 className={style.Texto}>Info de Contacto</h1>
            <img className={style.loadingtext} src="https://www.pngmart.com/files/22/Mr.-Rime-Pokemon-PNG.gif" alt="gif">Loading...</img>
        </div>
    )
}

export default Contacto;
